<div class="Parallax GParallax1"><div class="Img Binary"><div class="Caption"><a href="#"><div class="Text">Gestion de base de données avec MySQL<br></div></a></div></div><div class="Body2 Orange"><br>Le but de ce tutoriel est de vous apprendre la gestion de base de données avec <b>MySQL</b>.<br>Produit par <b>Gérard KESSE</b>.<br><br><div class="Content0 GSummary1"><div class="Row26">Summary 1</div></div><br></div></div><br><div class="Content2 GTitle1"><div class="MainBlock2"><div class="Content"><h1 class="Title2 Center" id="Introduction"><a class="Link3" href="#">Introduction</a></h1><div class="Body3"><br><b>MySQL </b>est un système de gestion de bases de données relationnelles (SGBDR). Il est distribué sous une double licence GPL et propriétaire. Il fait partie des logiciels de gestion de base de données les plus utilisés au monde, autant par le grand public (applications web principalement) que par des professionnels, en concurrence avec Oracle, PostgreSQL et Microsoft SQL Server.<br><br><img src="data:image/png;base64," alt=""><br><br></div></div></div></div><br><div class="Content2 GTitle1"><div class="MainBlock2"><div class="Content"><h1 class="Title2 Center" id="Installation-du-serveur-MySQL-sous-Windows"><a class="Link3" href="#">Installation du serveur MySQL sous Windows</a></h1><div class="Body3"><br>Installation du serveur MySQL sous Windows<br><br><div class="Content0 GSummary2"><div class="Row26">Summary 2</div></div><br><h2 class="Title7 GTitle2" id="Installation-du-serveur-MySQL-sous-Windows-Telechargement"><a class="Link9" href="#Installation-du-serveur-MySQL-sous-Windows">Téléchargement</a></h2><br><div class="Content0 GSummary3"><div class="Row26">Summary 3</div></div><br><h3 class="GTitle3" id="Installation-du-serveur-MySQL-sous-Windows-Telechargement-Lien-principal"><a class="Title8" href="#Installation-du-serveur-MySQL-sous-Windows-Telechargement">Lien principal</a></h3><br><img src="data:image/png;base64," alt=""><br><br><h3 class="GTitle3"